How to do SQL Server GROUP BY and ROW_NUMBER() subqueries in MongoDB<p>I am trying to translate a query from SQL Sever into a query for MongoDB. The table and the collection have the same data and structure at this time.</p>
<p>The final query in SQL Server looks like this. This query has subqueries and due to this and the use of ROW_NUMBER () to get the expected result I have not been able to replicate the same result in MongoDb.</p>
<p>FULL SQL Server Query</p>
<pre><code>
SELECT CodigoNodo, NivelTension, cantidad
    FROM (
            SELECT *,
            ROW_NUMBER() OVER (PARTITION BY CodigoNodo ORDER BY cantidad DESC) AS Top_niveltesion
            FROM (
                    SELECT CodigoNodo, NivelTension,COUNT(NivelTension) as cantidad
                    FROM QEnergia.FronteraInstalaciones
                    WHERE IdentificadorEmpresa=1
                    GROUP BY CodigoNodo,NivelTension
                ) SubconsultaInterna  
        ) Subconsulta
    WHERE Top_niveltesion = 1
    ORDER BY CodigoNodo;

</code></pre>
<p>To understand the result easier, here I show the result of this segment of the query.</p>
<pre><code>SELECT *,
            ROW_NUMBER() OVER (PARTITION BY CodigoNodo ORDER BY cantidad DESC) AS Top_niveltesion
